import React from 'react';

function NavBar() {
  return (
    <nav>
      <h2>Mi Tienda</h2>
      <ul>
        <li>Inicio</li>
        <li>Productos</li>
        <li>Contacto</li>
      </ul>
    </nav>
  );
}

export default NavBar;
